      out.write("var formatDate = function (date) {  \r\n");
      out.write("    var y = date.getFullYear();  \r\n");
      out.write("    var m = date.getMonth() + 1;  \r\n");
      out.write("    m = m < 10 ? '0' + m : m;  \r\n");
      out.write("    var d = date.getDate();  \r\n");
      out.write("    d = d < 10 ? ('0' + d) : d;  \r\n");
      out.write("    return y + '-' + m + '-' + d;  \r\n");
      out.write("}\r\n");
      out.write("function  addmulMonth(dtstr,n){   // n个月后 \r\n");
      out.write("\t\t   var yy=dtstr.substring(0,4);\r\n");
      out.write("\t   var mm=dtstr.substring(5,7);\r\n");
      out.write("\t   var dd=dtstr.substring(8,10);\t   \r\n");
      out.write(" \t  var  m1=mm.substring(0,1);\r\n");
      out.write(" \t  var  m2=mm.substring(1,2);\r\n");
      out.write(" \t var mmsum=0;\r\n");
      out.write(" \t  if(m1==0){\r\n");
      out.write(" \t\t mmsum=parseInt(m2)+parseInt(n);\r\n");
      out.write(" \t  }else{\r\n");
      out.write(" \t\t mmsum=parseInt(mm)+parseInt(n);\r\n");
      out.write(" \t  }\r\n");
      out.write(" \t  //给月和年设置值\r\n");
      out.write("\t  mm=parseInt(mmsum%12); \t\t  \r\n");
      out.write("\t  yy=parseInt(yy)+parseInt(mmsum/12);\r\n");
      out.write("\t if(mm<10){\r\n");
      out.write("\t \t mm=\"0\"+mm;\r\n");
      out.write("  \t  }\r\n");
      out.write(" \r\n");
      out.write("\t   var dt = yy+\"-\"+mm+\"-\"+dd;\r\n");
      out.write("\t   return dt;\r\n");
      out.write("\t} \r\n");
      out.write("\t//获得日期前一天\r\n");
      out.write("function getProjEndDate(str){\r\n");
      out.write("\t//var str = \"2010-08-01\";\r\n");
      out.write("\t// 转换日期格式\r\n");
      out.write("\tstr = str.replace(/-/g, '/'); // \"2010/08/01\";\r\n");
      out.write("\t// 创建日期对象\r\n");
      out.write("\tvar date = new Date(str);\r\n");
      out.write("\t// 减去一天\r\n");
      out.write("\tdate.setDate(date.getDate() - 1);\r\n");
      out.write("\t// 没有格式化的功能，只能一个一个取\r\n");
      out.write("\tstr = date.getFullYear() + '-'\r\n");
      out.write("\t    // 因为js里month从0开始，所以要加1\r\n");
      out.write("\t    + (parseInt(date.getMonth()) + 1) + '-'\r\n");
      out.write("\t    + date.getDate();\r\n");
      out.write("\treturn str;\r\n");
      out.write("}\r\n");
